package com.ufgov.zc.client.zc.ztb.model;import com.ufgov.zc.client.zc.ztb.model.face.ITemplate;public class PackDetails implements Cloneable, ITemplate {  private String id;  private String no;  private String name;  private String dir;  private String type;  private String status;  private String digestStr;  private boolean readonly;  private int ordIndex;  public Object clone() throws CloneNotSupportedException {    return super.clone();  }  public String getId() {    return id;  }  public void setId(String id) {    this.id = id;  }  public String getNo() {    return no;  }  public void setNo(String no) {    this.no = no;  }  public String getName() {    return name;  }  public void setName(String name) {    this.name = name;  }  public String getDir() {    return dir;  }  public void setDir(String dir) {    this.dir = dir;  }  public String getType() {    return type;  }  public void setType(String type) {    this.type = type;  }  public String getStatus() {    return status;  }  public void setStatus(String status) {    this.status = status;  }  public String getDigestStr() {    return digestStr;  }  public void setDigestStr(String digestStr) {    this.digestStr = digestStr;  }  public void setReadonly(boolean readonly) {    this.readonly = readonly;  }  public boolean isReadonly() {    return readonly;  }  public void setOrdIndex(int ordIndex) {    this.ordIndex = ordIndex;  }  public int getOrdIndex() {    return ordIndex;  }  public String toString() {    return this.getName();  }}